      path: "/",
      element: <LayoutPage />,
      errorElement:<ErrorPage/>,
      children: [
        { path: "/", element: <Home /> },
        { path: "about", element: <AbouPage /> },
      ],
    },
  ]);

  return <RouterProvider router={routes} />;
}

export default App;
